import { React } from 'react';
import UserForm from './UserForm/UserForm';
import UserData from './UserData/UserData';

function App() {

  let username = [
    {
      'Username': 'default',
      'Age': 'default',
    },
  ]

  return (
    <div>
      <UserForm />
      <UserData 
        username={username.Us}
      />
    </div>
  );
}

export default App;
